import Body from "./components/Body";
import { useAuth0 } from "@auth0/auth0-react";
import "../src/App.css"

function App() {

  const { isLoading } = useAuth0()

  if (isLoading) return <div>Loading...</div>

  return (
    <>
      <Body />
    </>
  );
}

export default App;
